import React from 'react'
import Navigation from '../Component/navigation/Navigation'
import { connect } from 'react-redux'
import { fetchImageRequest } from '../redux/images/ImageAction'



function ImageHistory(props) {

  return (
   <>
    <div>
      <Navigation/>
      <h2>images history</h2>
      <h5>title - {props.title}</h5>
    </div>
   </>
  )
}

const mapStateToProps = (state) => {
  return{
      images: state.galleryImages.images,
      title: state.galleryImages.title
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    imagesGallery: () => dispatch(fetchImageRequest())
  }
}

export default connect(mapStateToProps)(ImageHistory)
